// ** React Imports
import { lazy } from 'react'
import { Redirect } from 'react-router-dom'

const AppRoutes = [
  {
    path: '/apps/tellfari',
    exact: true,
    appLayout: true,
    className: 'tellfari-application',
    component: lazy(() => import('../../views/apps/tellfari'))
  },
  {
    path: '/apps/tellfari/:folder',
    exact: true,
    appLayout: true,
    className: 'tellfari-application',
    component: lazy(() => import('../../views/apps/tellfari')),
    meta: {
      navLink: '/apps/tellfari'
    }
  },
  {
    path: '/apps/tellfari/label/:label',
    exact: true,
    appLayout: true,
    className: 'tellfari-application',
    component: lazy(() => import('../../views/apps/tellfari')),
    meta: {
      navLink: '/apps/tellfari'
    }
  },
  {
    path: '/apps/tellfari/:filter',
    component: lazy(() => import('../../views/apps/tellfari')),
    meta: {
      navLink: '/apps/tellfari'
    }
  },
  {
    path: '/apps/instafriend',
    appLayout: true,
    className: 'instafriend-application',
    component: lazy(() => import('../../views/apps/instafriend'))
  },
  {
    path: '/apps/focus',
    exact: true,
    appLayout: true,
    className: 'focus-application',
    component: lazy(() => import('../../views/apps/focus'))
  },
  {
    path: '/apps/focus/:filter',
    appLayout: true,
    exact: true,
    className: 'focus-application',
    component: lazy(() => import('../../views/apps/focus')),
    meta: {
      navLink: '/apps/focus'
    }
  },
  {
    path: '/apps/focus/tag/:tag',
    appLayout: true,
    className: 'focus-application',
    component: lazy(() => import('../../views/apps/focus')),
    meta: {
      navLink: '/apps/focus'
    }
  },
  {
    path: '/apps/book',
    component: lazy(() => import('../../views/apps/book'))
  },
  {
    path: '/apps/invoice/list',
    component: lazy(() => import('../../views/apps/invoice/list'))
  },
  {
    path: '/apps/invoice/preview/:id',
    component: lazy(() => import('../../views/apps/invoice/preview')),
    meta: {
      navLink: '/apps/invoice/preview'
    }
  },
  {
    path: '/apps/invoice/preview',
    exact: true,
    component: () => <Redirect to='/apps/invoice/preview/4987' />
  },
  {
    path: '/apps/invoice/edit/:id',
    component: lazy(() => import('../../views/apps/invoice/edit')),
    meta: {
      navLink: '/apps/invoice/edit'
    }
  },
  {
    path: '/apps/invoice/edit',
    exact: true,
    component: () => <Redirect to='/apps/invoice/edit/4987' />
  },
  {
    path: '/apps/invoice/add',
    component: lazy(() => import('../../views/apps/invoice/add'))
  },
  {
    path: '/apps/invoice/print',
    layout: 'BlankLayout',
    component: lazy(() => import('../../views/apps/invoice/print'))
  },
  {
    path: '/apps/publish/shop',
    className: 'publish-application',
    component: lazy(() => import('../../views/apps/publish/shop'))
  },
  {
    path: '/apps/publish/wishlist',
    className: 'publish-application',
    component: lazy(() => import('../../views/apps/publish/wishlist'))
  },
  {
    path: '/apps/publish/product-detail',
    exact: true,
    className: 'publish-application',
    component: () => <Redirect to='/apps/publish/product-detail/apple-i-phone-11-64-gb-black-26' />
  },
  {
    path: '/apps/publish/product-detail/:product',
    exact: true,
    className: 'publish-application',
    component: lazy(() => import('../../views/apps/publish/detail')),
    meta: {
      navLink: '/apps/publish/product-detail'
    }
  },
  {
    path: '/apps/publish/checkout',
    className: 'publish-application',
    component: lazy(() => import('../../views/apps/publish/checkout'))
  },
  {
    path: '/apps/user/list',
    component: lazy(() => import('../../views/apps/user/list'))
  },
  {
    path: '/apps/user/view',
    exact: true,
    component: () => <Redirect to='/apps/user/view/1' />
  },
  {
    path: '/apps/user/view/:id',
    component: lazy(() => import('../../views/apps/user/view')),
    meta: {
      navLink: '/apps/user/view'
    }
  },
  {
    path: '/apps/roles',
    component: lazy(() => import('../../views/apps/roles-permissions/roles'))
  },
  {
    path: '/apps/permissions',
    component: lazy(() => import('../../views/apps/roles-permissions/permissions'))
  }
]

export default AppRoutes
